script: |
  super -f text -I q5633.spq | sort > q5633.out

inputs:
  - name: q5633.spq
    data: |
      SELECT DISTINCT 92 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE ( NULL ) BETWEEN col1 AND ( col2 * 3 - col2 ) AND NOT + col2 * + col0 + col0 IS NULL;
  - name: tab1

outputs:
  - name: q5633.out
    data: |
